import React, { useContext, useEffect, useState } from 'react';
import Register from '../Register';
import { useNavigate } from "react-router-dom";
import { AuthContext } from '../../Contexts/AuthContext';
import '../../css/Register.css';

const RegisterPage = () => {
  const { isAuthenticated } = useContext(AuthContext);

  const navigate = useNavigate();

  const [loading, setLoading] = useState(true);
  useEffect(() => {
    if (isAuthenticated === null) {
      // Still loading the authentication status
      console.log("It is null, loading")
      setLoading(true);
    } else if (isAuthenticated) {
      // Redirect to home if authenticated
      console.log("Is authenticted, go to /")
      navigate('/');
    } else {
      // Not authenticated, stop loading and render the Register form
      console.log("Is not authenticated, stop loading")
      setLoading(false);
    }
  }, [isAuthenticated]);

  if (loading) {
    console.log("Still loading")
    return null; // Or return a loading spinner here
  }

  console.log("Register component")
  return <Register />;
}

export default RegisterPage;
